import React from 'react';

import {ItemViewer} from './ItemViewer'




export class Search extends React.Component {
	constructor(props){
		super(props);
	}
	
	
	
	render(){
		
		let path = window.location.pathname;
		let path_split = path.split("/");
		
		
		let term_index = path_split.indexOf("search") + 1;
		
		let search_term = "";
		if(term_index <= path.split.length){
			search_term = path_split[term_index]
		}
		
		

		
		
		let search = this.props.search + "?" + search_term +"sold=false";
		
		return (
			<div>
				<div class="default-text-large">
					Enjoy searching!
				</div>
				
				
					<ItemViewer search={search}/>
				
				
				{search}
				
			</div>
		);
	};
		
	
}
